import CardsList from "./Cards/CardsList";
import ChipsList from "./Chips/ChipsList";
import ChoiceList from "./Choices/ChoiceList";
const Table = () => {
    return (<div className="flex flex-col justify-between">
        <Header />
        <CardsList />
        <ChoiceList />
        <div>
        <ChipsList />

        </div>
    </div>);
}
export default Table;
